import { AntDesign } from "@expo/vector-icons";
import React from "react";
import { Text, TouchableOpacity, View } from "react-native";

export default () => {
    return <View style={{ flex: 1, justifyContent: "center", alignItems: "center" }}>
        {isLoggedIn === true ? (
            <TouchableOpacity onPress={logUserOut}><Text>I'm in ╰(*°▽°*)╯ <AntDesign name="star" size={60} color="black" /></Text>
            </TouchableOpacity>) :
            (<TouchableOpacity onPress={logUserIn}>
                <Text>I'm Out  (T_T))  <AntDesign name="staro" size={60} color="black" /></Text>
            </TouchableOpacity>
            )}
    </View>
}
